import React from 'react';
import './App.css';
import Story from './components/Story';

function App() {
  const fetchStories = async () => {
    const list = await fetch("https://sv-reqres.now.sh/api/listings");
    return await list.json();
  }

  fetchStories();

  return (
    <div className="wrapper">
      <Story title="Test" story="some story" url="apple.com"/>
    </div>
  );
}

export default App;
